import { Link } from 'react-router-dom';
import React from 'react'
import './css/top_nav.css'

export default function TopNav(){
    return(
        <nav className='nav_wrapper'>
            <ul className='ul__top_nav'>
                <li><Link to={'/'}>Libros Maldonado</Link> a su servicio desde 1968</li>
                <li><a href="#contact_info" className="link underline">Contactos</a></li>
                <li><Link to='/faq' className="link underline">Preguntas frecuentes</Link></li>
            </ul>
        </nav>
    )
}
